class CustomText(Text):
    '''A text widget with a new method, HighlightPattern 

    example:

    text = CustomText()
    text.tag_configure("red",foreground="#ff0000")
    text.HighlightPattern("this should be red", "red")

    The HighlightPattern method is a simplified python 
    version of the tcl code at http://wiki.tcl.tk/3246
    '''
    def __init__(self, *args, **kwargs):
        Text.__init__(self, *args, **kwargs)

    def HighlightPattern(self, pattern, tag, start="1.0", end="end", regexp=True):
        '''Apply the given tag to all text that matches the given pattern'''

        start = self.index(start)
        end = self.index(end)
        self.mark_set("matchStart",start)
        self.mark_set("matchEnd",end)
        self.mark_set("searchLimit", end)

        count = IntVar()
        while True:
            index = self.search(pattern, "matchEnd","searchLimit",count=count, regexp=regexp)
            if index == "": break
            self.mark_set("matchStart", index)
            self.mark_set("matchEnd", "%s+%sc" % (index,count.get()))
            self.tag_add(tag, "matchStart","matchEnd")


def ConnectGet(search):
    try:
        search = search.replace(' ','+')
        # https://bitcq.com/api/v8/search?q=Build+Responsive+Real+World+Websites+with+HTML5+and+CSS3&category[]=false
        myurl = 'https://bitcq.com/api/v8/search?q={}&category[]=false'.format(search)
        req = Request(myurl)
        req.add_header('Content-Type','application/json')
        req.add_header('User-Agent','Mozilla/5.0')
        response = urlopen(req).read().decode('utf-8')
        return response
    except Exception as ex :
        print(ex)

def GetProductsInfo(event=None):
    global arr
    if part_text.get():
        response = ConnectGet(part_text.get())
        if '"results":"0"' in response:
            status_text = 'Sorry, we did not find anything :('
            populate_list([{'name':'Sorry, we did not find anything :(','magnet':'','files':'','peers':'','size':''}])
        else:
            data        = loads(response)
            Json_count  = response.count('"name"')
            status_text = '{} Products found'.format(Json_count)
            arr = []
            for i in range(0,Json_count):
                name   = data[str(i)]['name']
                magnet = data[str(i)]['magnet']
                files  = data[str(i)]['files']
                peers  = data[str(i)]['peers']
                size   = data[str(i)]['size']
                arr.append({'name':name,'magnet':magnet,'files':files,'peers':peers,'size':size})
                Total_DAta[name] = magnet
            populate_list(arr)


